import{_ as e,o as a,c as r,O as t}from"./chunks/framework.6305ff1a.js";const g=JSON.parse('{"title":"0905 本周总结","description":"","frontmatter":{},"headers":[],"relativePath":"record-2021/09/0905-week-summary.md","filePath":"record-2021/09/0905-week-summary.md"}'),l={name:"record-2021/09/0905-week-summary.md"},i=t('<h1 id="_0905-本周总结" tabindex="-1">0905 本周总结 <a class="header-anchor" href="#_0905-本周总结" aria-label="Permalink to &quot;0905 本周总结&quot;">​</a></h1><p><img src="http://h2.ioliu.cn/bing/MoonJellyDay_ZH-CN4121466496_1920x1080.jpg" alt=""></p><h2 id="问题盘点" tabindex="-1">问题盘点 <a class="header-anchor" href="#问题盘点" aria-label="Permalink to &quot;问题盘点&quot;">​</a></h2><p><strong>技术问题</strong>：</p><ul><li>typescript 的 enum 是类型还是类型值？</li></ul><p>答案：类型。Typescript 的 <a href="https://www.runoob.com/typescript/ts-type.html" target="_blank" rel="noreferrer">基础类型包括这些</a></p><ul><li>代码 review：</li></ul><p>写代码还是需要多和牛逼的人交流，或者是留给自己时间去 review 一下他人的代码实现，多学习；给自己时间做一些创造性的东西，比如一些 好用的组件，交互的痛点处理方案。这样才能体现自己的价值。否则每天只是重复的搬砖，只不过是重量不同，加班程度不同而已。</p><ul><li>代码设计：</li></ul><p>思考自己的写法是否合理：特别是在 onchange 里面做一些数据操作的时候，考虑优化成 useEffect, useMemo 方案，类似 Vue 的 watch 以及 compouted，这样可以节省很多气力，代码也更优雅。</p><ul><li>重复 render 问题：uuid 滥用问题。解决方法： <ul><li>数据源的起始端加 uuid，从而保证后面状态变更的 id 不会再变了；</li><li>直接使用 map 的 index 作为 key；但是某些场景（排序，删除节点）不能使用 index 作为 key。</li></ul></li></ul><p><strong>协作问题</strong>：</p><ul><li>经常加班的原因： <ul><li>需求分析不全面：注意一些边边角角的细节，没考虑到位，以及各种异常，页面的后续动作等。</li><li>自评时间不够：需要 <strong>详细拆分任务项，每一个任务项给定工时</strong></li><li>技术设计：接口设计一定要 95% 以上的准确性，避免后期返工导致工作量大。</li><li>开发自测：一定要亲自走完全流程，从 ui 到接口。否则联调过程中， bff 若没自测 bug 多修阻塞流程就很难受</li></ul></li><li><strong>不要把公司的任何东西放到 github 公开仓库</strong>：</li></ul><p>我在博客上挂了一个公司前端建设的链接，被公司安全部门私聊了</p><ul><li><strong>心态控制</strong>：</li></ul><p>加班多了，心情自然会烦躁；</p><p>在和 产品和测试 argue 的过程中，即使意见不同，也要心平气和。argue 的过程，也是彼此学习的过程。过程中，可以发现自己的不好的开发习惯，可以发现好的交互体验，可以发现公司产品的弊端。</p><ul><li>遇到<strong>奇怪的需求</strong></li></ul><p>可以先问问大佬的实现思路，问问项目中是否有提供好的工具配置，可以多问问其他大佬，博采众长，改正自己低级的方案和错误方向。</p><h2 id="任务总结" tabindex="-1">任务总结 <a class="header-anchor" href="#任务总结" aria-label="Permalink to &quot;任务总结&quot;">​</a></h2><blockquote><p>本周任务完成度，完成感受/未完成理由</p></blockquote><h2 id="笔记输出" tabindex="-1">笔记输出 <a class="header-anchor" href="#笔记输出" aria-label="Permalink to &quot;笔记输出&quot;">​</a></h2><ul><li>jd 自动签到领豆的白嫖活动：<a href="https://github.com/xcqlucky/JD_Sign_Action" target="_blank" rel="noreferrer">基于github action的京东自动化签到 </a></li><li><a href="https://www.bilibili.com/video/BV1uf4y1V762" target="_blank" rel="noreferrer">京东签到脚本+腾讯云函数领取京豆，每天免费自动</a></li><li><a href="https://guozh.net/jingdong-sign-in-script/" target="_blank" rel="noreferrer">京东签到脚本+腾讯云函数获取京豆，视频+图文教程（2021成功）</a></li></ul><h2 id="周末学习" tabindex="-1">周末学习 <a class="header-anchor" href="#周末学习" aria-label="Permalink to &quot;周末学习&quot;">​</a></h2><h2 id="下周任务" tabindex="-1">下周任务 <a class="header-anchor" href="#下周任务" aria-label="Permalink to &quot;下周任务&quot;">​</a></h2>',25),o=[i];function n(u,s,c,h,p,d){return a(),r("div",null,o)}const m=e(l,[["render",n]]);export{g as __pageData,m as default};
